import React from 'react';
import { Link } from 'react-router-dom'; // If you're using React Router

const Header = ({ view, setView, onNewTrip, onOpenSettings, onOpenTemplates }) => {
  return (
    <header className="bg-blue-600 text-white p-4 shadow-md">
      <div className="container mx-auto flex justify-between items-center">
        <div className="flex items-center">
          <img src="/logo.svg" alt="TravelEase" className="h-8 w-8 mr-2" />
          <h1 className="text-xl font-bold">TravelEase</h1>
        </div>
        
        <nav className="hidden md:flex space-x-6">
          <button 
            className={`py-2 ${view === 'dashboard' ? 'border-b-2 border-white' : ''}`}
            onClick={() => setView('dashboard')}
          >
            Dashboard
          </button>
          <button 
            className={`py-2 ${view === 'planner' ? 'border-b-2 border-white' : ''}`}
            onClick={() => setView('planner')}
          >
            Plan Trip
          </button>
          <button 
            className={`py-2 ${view === 'trips' ? 'border-b-2 border-white' : ''}`}
            onClick={() => setView('trips')}
          >
            My Trips
          </button>
          <button 
            className={`py-2 ${view === 'flights' ? 'border-b-2 border-white' : ''}`}
            onClick={() => setView('flights')}
          >
            nav.flights
          </button>
        </nav>
        
        <div className="flex items-center space-x-3">
          <button 
            onClick={onOpenSettings}
            className="p-2 rounded hover:bg-blue-700"
            aria-label="Settings"
          >
            <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M10.325 4.317c.426-1.756 2.924-1.756 3.35 0a1.724 1.724 0 002.573 1.066c1.543-.94 3.31.826 2.37 2.37a1.724 1.724 0 001.065 2.572c1.756.426 1.756 2.924 0 3.35a1.724 1.724 0 00-1.066 2.573c.94 1.543-.826 3.31-2.37 2.37a1.724 1.724 0 00-2.572 1.065c-.426 1.756-2.924 1.756-3.35 0a1.724 1.724 0 00-2.573-1.066c-1.543.94-3.31-.826-2.37-2.37a1.724 1.724 0 00-1.065-2.572c-1.756-.426-1.756-2.924 0-3.35a1.724 1.724 0 001.066-2.573c-.94-1.543.826-3.31 2.37-2.37.996.608 2.296.07 2.572-1.065z" />
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 12a3 3 0 11-6 0 3 3 0 016 0z" />
            </svg>
          </button>
          
          <button 
            onClick={onNewTrip}
            className="bg-white text-blue-600 py-2 px-4 rounded font-medium hover:bg-gray-100"
          >
            + Plan Trip
          </button>
        </div>
      </div>
    </header>
  );
};

export default Header;
